import React from "react";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

function Doctor() {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "40vh",
        width: "50vh 50vh",
        border: "2px solid black", // Add a black border
        margin: "120px 540px 120px 540px", // Add margin around the component
      }}
    >
      
      <Form>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label size="lg">Email</Form.Label>
          <Form.Control type="email" size="lg"/>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label size="lg">Password</Form.Label>
          <Form.Control type="password" size="lg"/>
        </Form.Group>

        <Button variant="dark" type="submit" size="lg">
          Login
        </Button>
      </Form>
    </div>
  );
}

export default Doctor;
